const Article = ({ article }) => {
  return (
    <div className="article">
      <div className="card-header">
        <h3>{article.author}</h3>
        <em>Post√© le {article.date}</em>
      </div>
      <p>{article.content}</p>
      <div className="btn-container">
        <button>Edit</button>
        <button>Delete</button>
      </div>
    </div>
  );
};

export default Article;
